import React from "react";
import IconLinkedin from "../icons/linkedin"
import IconInstagram from "../icons/instagram";
import IconGitHub from "../icons/github";

const Socials = () => {
    return (
        <div className="flex flex-col min-w-36 pb-16 items-center justify-end h-svh">

            <div className=" z-10 gap-6 w-full h-fit pt-6 flex flex-col items-center ">
                <p className="rotate-[90deg] mb-10">kt.ye@mail.utoronto.ca</p>
                <a href='https://www.linkedin.com/in/katherineytye/' target='_blank' className="transition ease-in-out duration-300 hover:-translate-y-2"> <IconLinkedin/></a>
                <a href='https://www.instagram.com/_chezkath/' target='_blank' className="transition ease-in-out duration-300 hover:-translate-y-2"> <IconInstagram/></a>
                <a href='https://github.com/kyoety' target='_blank' className="transition ease-in-out duration-300 hover:-translate-y-2"> <IconGitHub/></a>
            </div>

        </div>
    );
};  

export default Socials;
